import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import Navbar from './components/layouts/Navbar';
import Home from './components/pages/Home';
import Socket from './components/pages/Socket';
import Header from './components/components/Header';
import Maps from './components/components/Maps';
import Footer from './components/components/Footer'
import {useState , useEffect} from 'react'
import io from "socket.io-client";
const socket = io();

function App() {
	const [robotTime, setrobotTime] = useState("");
	const [robotStatus, setrobotStatus] = useState("");
	const [robotMode, setrobotMode] = useState("");
	useEffect(() => {
		console.log("Emiting")
		socket.on('robotStatus',data=>{
			setrobotStatus(data)
		})
		socket.on("FromAPI", data => {
			setrobotTime(data);
		});
		socket.on('robotMode',data => {
			setrobotMode(data)
		})
	  }, []);
	return (

		<Router>

			<Switch>
				<Route exact path='/'>
					{' '}
					<div >
				<Navbar />
			</div>
					<Header time={robotTime} setrobotMode={setrobotMode} robotStatus={robotStatus} />
					<Home />
					<Footer/>
				</Route>
					<Route exact path='/map'>
					<Maps />
					</Route>
				<Route exact path="/test" >
					<Socket/>
				</Route>
			</Switch>

		</Router>
	);
}

export default App;
